import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  blockSubmit:{
    display:'flex',
    marginTop:20,
    alignItems:'center',
    justifyContent:'space-between'
  },
  staySing:{
    display:'none'
  },
  blockButton:{
    justifyContent:'end'
  }
})
